import { Navigation } from "./navigation";
import "/Users/pareespradhan/Desktop/aiis_page/frontend/my-react-app/public/css/style.css";

export const Services = (props) => {
  return (


    <div id="services" className="text-center">
      <Navigation />
      <div className="container">
        <div className="section-title">
          <h2>Upcoming Events</h2>
          <p>
            Take note of our upcoming events!
          </p>
        </div>
        <div className="row">
          <div className="card-container" > {props.data? props.data.map((d, i) => (
                <div key={`${d.name}-${i}`} className="col-xs-6 col-md-3">
                  <div class="card" >
                    <img src={d.img} alt="..." className="card-img" />
                    <div class="card__details">
                      <div class="name">
                        <h4>{d.header}</h4>
                      </div>
                      <h4>{d.date_time}</h4>
                      <a className="btn btn-primary"> View Details</a>
                  </div>
                </div>

                </div>
              ))
            : "loading"}



          </div>
        </div>

        </div>
      </div>
  );
};
